powershell # GENESIS-11155 - ICST 2.1 Transition
# Since DO 4.2, DO will install ICST 2.1 if IPF > 1.0.110 or install ICST 2.0 otherwise.
# To avoid the potential issue about removing ICST, DO will try to uninstall ICST 2.1 instead of ICST 2.0 as IPF driver might be upgraded after installing DO
# We use this custom action to check which version is installed on the system and delete it instead of using InstallShield default remove behavior.

trace-suiteinfo -LogMessage Entering RemoveIntelContextService.ps1
$SupportDir = get-suiteproperty -name SETUPSUPPORTDIR
trace-suiteinfo -LogMessage SETUPSUPPORTDIR: $SupportDir
$UtilityScript = Join-Path -Path $SupportDir -ChildPath Utility.ps1
try {
    Set-ExecutionPolicy -ExecutionPolicy RemoteSigned -Force
}
catch {
    trace-suiteinfo -LogMessage Failed to set execution policy: $$Error[0]
}
.$UtilityScript

$ProgramFilesFolder = [Environment]::GetEnvironmentVariableProgramW6432
$IUAS_MSI = Join-Path -Path $ProgramFilesFolder -ChildPath \Dell\Downloaded_Installations\{58596D9B-DA0A-4311-AA32-CA982D8C0185}\Intel_User_Awareness_Service.msi;
$IUAS_EXE = Join-Path -Path $ProgramFilesFolder -ChildPath \Dell\Downloaded_Installations\{58596D9B-DA0A-4311-AA32-CA982D8C0185}\Intel_User_Awareness_Service.exe;
$ICSS = Join-Path -Path $ProgramFilesFolder -ChildPath \Dell\Downloaded_Installations\{D6FF1773-861D-4394-BAFC-D4D3E911031B}\Intel_Context_Sensing_Service.exe;

if Test-Path $IUAS_MSI -PathType Leaf {
	$MsiExec = [System.Environment]::SystemDirectory  \msiexec.exe
	trace-suiteinfo -LogMessage Try to uninstall previous IUAS -> $MsiExec /x $IUAS_MSI /qn /norestart
	.$MsiExec /x $IUAS_MSI /qn /norestart
	trace-suiteinfo -LogMessage Return code: $?
}

if Test-Path $IUAS_EXE -PathType Leaf {
	trace-suiteinfo -LogMessage Try to uninstall IUAS -> $IUAS_EXE /q /uninstall
	.$IUAS_EXE /q /uninstall
	trace-suiteinfo -LogMessage Return code: $?
}

if Test-Path $ICSS -PathType Leaf {
	trace-suiteinfo -LogMessage Try to uninstall ICSS -> $ICSS /uninstall /s
	.$ICSS /uninstall /s
	trace-suiteinfo -LogMessage Return code: $?
}

$PNPUTIL = Join-Path -Path $Env:SystemRoot -ChildPath sysnative\pnputil.exe
$OEMList = & $PNPUTIL /enum-drivers | 
	Select-String -Pattern Published Name, Original Name | 
	ForEach-Object {$_.Line.Split } | 
	Select-String -Pattern .inf | 
	ForEach-Object {$_.ToString.Trim}

[System.Collections.ArrayList]$INFRemoveList = @icst_extension.inf, icst_service.inf
ForEach $INF in $INFRemoveList {
	$line = 0
	while $line -lt $OEMList.Count {
		if $OEMList[$line  1] -eq $INF {
			trace-suiteinfo -LogMessage Trying to uninstall $INF...
			$output = & $PNPUTIL /delete-driver $OEMList[$line] /force /uninstall
			trace-suiteinfo -LogMessage $output
			Start-Sleep -s 1
		}
		$line = 2
	}
}

# Remove log/setting files
$ICSTDataFolderLagacy = Join-Path -Path $Env:SystemRoot -ChildPath \ServiceProfiles\LocalService\AppData\Roaming\IntelR\ICST
RemoveFolder$
